pragma solidity >=0.4.22 <0.9.0;

contract Wallet {
    address payable public owner;

    constructor(address payable _owner) {
        owner = _owner;
    }

    function deposit() public payable {}

    function balanceOf() public view returns (uint256) {
        return address(this).balance;
    }
}
